import React from 'react';
import { GoogleMap, Marker, InfoWindow } from '@react-google-maps/api';

const containerStyle = {
  width: '100%',
  height: '400px'
};

const center = {
  lat: 37.7749,
  lng: -122.4194
};

function App() {
  return (
    <div>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={12}
      >
        <Marker position={center}>
          <InfoWindow>
            <div>
              <h3>Marker Title</h3>
              <p>Marker Description</p>
            </div>
          </InfoWindow>
        </Marker>
      </GoogleMap>
    </div>
  );
}

export default App;
